import { useState } from "react";

const Forms = (props) => {
  const [arrToUpdate, setArrToUpdate] = useState(props.objArr);

  const allRequiredInputs = arrToUpdate.map((e, index) => {
    return (
      <tr key={index}>
        <td id={index}>{e.name}</td>
        <td>{e.buydate}</td>
        <td>${e.buyprice.toFixed(2)}</td>
        <td>{e.selldate}</td>
        <td>{e.selldate !== "" && "$" + e.sellprice.toFixed(2)}</td>
      </tr>
    );
  });

  return (
      <div className="formtable">
        <div>
          <h2>Please input damage & heals here</h2>
        </div>
        <table>
          <tr>
            <th>Name</th>
            <th>Purchase Date</th>
            <th>Damage</th>
            <th>Sell Date</th>
            <th>Heal</th>
          </tr>
          {allRequiredInputs}
        </table>
      </div>
  );
};

export default Forms;
